"fixed": |-
  1. (O) /SET/ The name of a SET private extension that indicates whether the CA or the payment gateway supports passing encrypted messages to the cardholder through the merchant. If so, the extension lists OIDs of symmetric encryption algorithms that are supported.
"ko": |-
  1. (O) /SET/ CA 또는 지불 게이트웨이가 판매자를 통해 카드 소지자에게 암호화된 메시지 전달을 지원하는지 여부를 나타내는 SET 개인 내선 번호의 이름입니다. 그렇다면 확장 프로그램은 지원되는 대칭 암호화 알고리즘의 OID를 나열합니다.
